        selector.datepicker({
            format: ""dd/mm/yyyy"",
            startDate: getTheNextDay(new Date()),
            todayHighlight: true,
            autoclose: true,
            language: currentLanguage
        });
        selector.keydown(function (event) {
            return false;
        });
    }
    function getTheNextDay(date) {
        const tomorrow = new Date(date);
